(52, 'woocommerce-shipping-fedex-api-outage-2023-07-16', 'warning', 'en_US', 'Scheduled FedEx API outage — July 2023', 'On July 16 there will be a full outage of the FedEx API from 04:00 to 08:00 AM UTC. Due to planned maintenance by FedEx, you\'ll be unable to provide FedEx shipping rates during this time. Follow the link below for more information and recommendations on how to minimize impact.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(53, 'wcship-2023-07-hazmat-update-needed', 'update', 'en_US', 'Action required: USPS HAZMAT compliance update for WooCommerce Shipping & Tax extension', '<strong>Your store requires an update for the WooCommerce Shipping extension</strong>. Please update to the latest version of the WooCommerce Shipping &amp; Tax extension immediately to ensure compliance with new USPS HAZMAT rules currently in effect.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(54, 'woocommerce-WCStripe-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe plugin', '<strong>Your shop requires an important security update for the  WooCommerce Stripe plugin</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(55, 'woocommerce-WCStripe-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooCommerce Stripe plugin', '<strong>Your store has been updated to the latest secure version of the WooCommerce Stripe plugin</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(56, 'woocommerce-WooPayments-Aug-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooPayments (WooCommerce Payments) plugin', '<strong>Your shop requires an important security update for the WooPayments (WooCommerce Payments) extension</strong>. The fix for this vulnerability was released on July 31. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(59, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'Klarna_10OCT23', 'marketing', 'en_US', 'Klarna is now available', 'This is a test. Klarna is now available.', '{}', 'pending', 'woocommerce.com', '2023-10-11 07:31:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(62, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'Cara menyesuaikan katalog produk Anda', 'Anda pasti ingin katalog produk dan gambar terlihat bagus dan sesuai dengan merek Anda. Panduan ini akan memberikan semua tips yang diperlukan agar produk Anda tampil keren di toko.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:58:04', NULL, 0, 'plain', '', 0, 1, 'info'),
(63, 'wc-admin-onboarding-payments-reminder', 'info', 'en_US', 'Mulai menerima pembayaran di toko Anda!', 'Ambil pembayaran dengan penyedia yang cocok dengan Anda - pilih dari 100+ gerbang pembayaran untuk WooCommerce.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:58:04', NULL, 0, 'plain', '', 0, 1, 'info'),
(64, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Bantu WooCommerce menjadi lebih baik dengan pelacakan penggunaan', 'Mengumpulkan data penggunaan memungkinkan kami meningkatkan WooCommerce. Toko Anda akan dipertimbangkan selagi kami mengevaluasi fitur baru, menilai kualitas pembaruan, atau menentukan apakah sebuah pembaruan masuk akal. Anda selalu dapat mengunjungi <a href=\"http://localhost/wordpress/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Pengaturan</a> dan memilih untuk berhenti berbagi data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Baca selengkapnya</a> tentang data yang kami kumpulkan.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-18 06:58:04', NULL, 0, 'plain', '', 0, 1, 'info'),
(65, 'wc_com_in_person_payments_card_sale_US_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our M2 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-18 06:58:20', NULL, 0, 'plain', '', 0, 0, 'info'),
(66, 'wc_com_in_person_payments_card_sale_UK_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Now’s the perfect time to do so, as we’re discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Don’t miss out — this offer ends 29th October 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-18 06:58:20', NULL, 0, 'plain', '', 0, 0, 'info'),
